import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
    const [count, setCount] = useState();
    useEffect(() => {
        fetch(`https://jsonplaceholder.typicode.com/posts/1`)
        .then((res) => res.json())
            .then((data) => {
                const { body } = data;
                console.log(body);
            })
    })

  return (
    <div className="App">
      <h1>Welcome to Home</h1>
    </div>
  );
}

export default App;
